export const PATH_ALL = '/products/all';
export const PATH_MATH = '/products/math';
export const PATH_PROGRAMMING = '/products/programming';
export const PATH_PHYSICS = '/products/physics';

export const LINKS_GENERAL_MENU = [
    { path: PATH_ALL, label: 'All' },
    { path: PATH_MATH, label: 'Math' },
    { path: PATH_PROGRAMMING, label: 'Programming' },
    { path: PATH_PHYSICS, label: 'Physics' }
]
